    false,nt"url": null,nt"notes": "During a December 1981 Threats and Conflicts
    survey, twenty-five resource problems were identified for Wyandotte National Wildlife
    Refuge. This plan summarizes current status and measures taken to address these
    problem areas as well as limited changes in the original list. In some cases, specific
    problems, as listed in the December 1981 report, have been grouped (i.e. airborne
    chemicals such as sulfur dioxide, lead, and nitrogen oxides). These are reported
    as a single problem area since any actions are on a collective basis.",nt"license_title":
